script: |
  super -f text -I q3528.spq | sort > q3528.out

inputs:
  - name: q3528.spq
    data: |
      SELECT DISTINCT - ( - + 89 ) + + col2 - + 10 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col1 + - - col0 - - 4 + - col1 IN ( col0 / - - ( + - col0 ) + col1 - + 89, - 24 * col1 + - - col0 + + col1, + - col2 );
  - name: tab0

outputs:
  - name: q3528.out
    data: |
      126
      178
      89
